    true,nt"url": null,nt"notes": "The index is a significant innovation in
    its field that measures multiple indicators of empowerment, and generates "scores"
    that can be compared over time. It is the first tool of its kind. Piloted in 2011
    and launched in February 2012, the US government is using the index to track change
    in women's empowerment that occurs as a direct or indirect result of Feed the Future
    interventions in targeted geographic zones within the initiative's 19 focus countries.
    Data for the WEAI will be collected every two years in all 19 countries, and baselines
    were collected in 2011 and 2012. USAID and partners will conduct data analyses to
    understand the relationships among empowerment, livelihoods, and food security,
    as well as relationships among the various components of the index. Feed the Future
    will also use the WEAI for impact evaluations of distinct projects to examine the
    effectiveness of different approaches and how they impact women and men. To protect
    the personal information of respondents, all personal identifiable information was
    removed.",nt"license_title": "Other License Specified",nt"extras": [{ntt"key":
